var kmlLayer = null;
function BuildPlacemarkKml() {
	var filename = document.getElementById('KmlNameProperty').value
	console.log(filename)
	kmlLayer = new google.maps.KmlLayer('https://raw.githubusercontent.com/Dhalizm/NauticalWrecks/main/' + filename, {
		suppressInfoWindows: true,
		preserveViewport: false,
	});
	console.log("build place markers")

	var infowindow = new google.maps.InfoWindow();
	kmlLayer.addListener('click', function (event) {
		infowindow.close();
		var content = event.featureData.infoWindowHtml;
		infowindow.setOptions({
			content: content,
			pixelOffset: event.pixelOffset,
		});
		infowindow.setPosition(event.latLng);
		infowindow.open(map);
	});
}

function showKmlLayer() {
	kmlLayer.setMap(map);
}


function hideKmlLayer() {
	kmlLayer.setMap(null);
}
